import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from "../components/images/black_x.jpg";
import axios from 'axios';

const Create = () => {
  const [user, setUser] = useState({
    username: "",
    phone_no: "",
    month: "",
    date: "",
    year: "",
  });
  const currentYear = new Date().getFullYear();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(user);
    // Submit your data to the server here
  };

  return (
    <form onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in">
        <span className="cross_div">
          <a className="cre" href="/public">
            <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
          </a>
        </span>
        <div className="nav_1">
          <div>
            <img
              height="60px"
              width="60px"
              className="x-mark"
              src={black_x}
              alt="x-mark"
            />
          </div>
        </div>
        <div className="down-box">
          <div className="content">
            <p className="acc">Create Account</p>
            <input
              className="box_1"
              type="text"
              name="username"
              value={user.username}
              onChange={handleChange}
              placeholder="Name"
              maxLength="50"
            />
            <input
              className="box_1"
              type="tel"
              name="phone_no"
              value={user.phone_no}
              onChange={handleChange}
              placeholder="Phone Number"
              maxLength="20"
            />
            <div className="_line "><div>Use Email Instead</div></div>
            <div className="dob">Date of Birth</div>
            <div>This will not be shown publicly. Confirm your own age, even if this account is for a business, a pet, or something else.</div>
            <div className="all_boxes">
              <div className="box_A month">
                <label>Month</label>
                <select name="month" value={user.month} onChange={handleChange} className="select">
                  {/* Options for months */}
                </select>
              </div>
              <div className="box_A date">
                <label>Date</label>
                <select name="date" value={user.date} onChange={handleChange} className="select">
                  {/* Options for dates */}
                </select>
              </div>
              <div className="box_A year">
                <label>Year</label>
                <select name="year" value={user.year} onChange={handleChange} className="select">
                  {/* Options for years */}
                </select>
              </div>
            </div>
            <button type="submit" className="box_ grey">Next</button>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
};

export default Create;
